import React from "react";

const SendInput = () => {
  return (
    <form action="" className="px-4 my-3">
      <div className="w-full relative">
        <input
          type="text"
          placeholder="send a message"
          className="border text-sm rounded-md block w-full bg-grey--600 text-white border-zinc-500"
        />
        <button>
            <IoSend/>
        </button>
      </div>
    </form>
  );
};

export default SendInput;
